import axios from 'axios';

const aTypeGetCookieData = 'GetCookieData';
const aTypeSetShowLoader = 'SetShowLoader';

function getCookieData(val){
    return {
        type: aTypeGetCookieData,
        val
    }
}

function setShowLoader(val){
    return {
        type: aTypeSetShowLoader,
        val
    }
}

function getCookieDataAsync(){
    console.log('done')
    const getCookiesUrl = 'http://localhost:3001/cookie/getAll';
    return (dispatch)=>{
        axios.get(getCookiesUrl, {
            timeout: 5000
        })
        .then((res)=>{
            dispatch(getCookieData(res.data));
            setShowLoader(false);
        })
        .catch((e)=>{
            console.log(e.message);
            setShowLoader(false);
        });
    }
}

export {
        aTypeGetCookieData,
        aTypeSetShowLoader,
        setShowLoader,
        getCookieDataAsync
    }
